    - '2012-09-12'
    - Elbows underneath the bar at the same time feet hit the floor.  Be smooth and
      continuous from the bottom of the catch and moving up.  Split jerk with feet
      further apart.  Make sure I split far apart with light weight to practice the
      correct position for heavier weight.  I didn't split far enough on my heaver
      weight jerks.  Straight up and down on clean pulls like I'm jumping straight
      up into the air.
